INSERT INTO `welcome_text` (`welcome_text`) VALUES
	('Welcome to the Agora Knowledgebase.\r\n\r\nThe Agora System is one piece in a Suite of tools  designed to provide marketing professionals access to a market view that would otherwise be virtually impossible to see, let alone organize, search and present meaningfully. ESSENTIA\'s Agora, BrandScope and OASIS Systems comprise a trio of powerful and easily-affordable resources to answer critical business questions from marketing, MarComm, PR and other business teams. \r\n\r\nEssentia systems are proprietary systems designed and developed from the ground up using cutting-edge technology. Critical data entry work is performed by scientists who understand the advertising messages. \r\n\r\nEssentia product development is completely driven by customer feedback. When you have an idea, tell us so that we can add it to our To-Do list. If you have a problem, maybe we can guide you to the information, fix the problem or improve a system. Either way, tell us what you want and what would improve the experience. \r\n\r\nNEWS:\r\nPlease let us know if you have suggestions for other life science websites. Contact our offices regarding data for other markets.\r\n\r\nHISTORIC DATA:\r\nYour subscription to the Agora System begins with January 2012. Please do not depend on searches for earlier data. \r\n\r\nKEYWORD SEARCHES ON FULL TEXT AD COPY:\r\nThe full text of every advertisement is manually indexed in the database. Searching the Keyword field provides access to this data set. \r\n\r\nWHAT AGORA DOES DO:\r\nThe Agora(TM) Knowledgebase is designed to visualize the marketing landscape more proportionally and thoroughly than any product has ever represented it. The System gives you enormous insight into what advertisers in your space are communicating, on what channels they are communicating, and who else may be competing for the same audience attention as you are. \r\nThe Agora System also provides a unique ability to identify advertising trends, compare creative and brand ID, observe key differences in strategy, and more easily monitor channels of interest to you that any other means can provide. \r\n\r\nTHE AGORA SYSTEM IS NOT A QUANTITATIVE TOOL: \r\nThere is no practical way to measure every advertisement on every page of every channel every minute. No system can provide that. The metrics we do provide are there to add "texture" to the other data presented.\r\n\r\nQUALITY AUDITING:\r\nRoutine manual audits of the Agora System assure the highest possible data integrity and optimum ad representation.\r\n\r\nDRILLDOWN LEVELS:\r\nIn each report, the top "layer" primarily describes the ad information, while any drilldowns will show ad placement detail.\r\n\r\nDATA INTEGRATION:\r\nAt this time, Essentia is not combining the data for other channels like print and PR with digital display due to the disparate nature of the data types and metrics. If you utilize all of our systems you can probably see why. As we build out new tools and new capabilities, there are integrations you will start to see in 2013. \r\n\r\nYOUR IDEAS:\r\nAs always, we welcome your ideas, your critiques, and a better understanding of your needs and wants. It\'s the only way we can grow together.\r\n\r\nThank you for using the Agora Knowledgebase.');
